import React from 'react'
import MenuItem from '../../components/menu-items/menu-item.component'
import './homepage.styles.scss'

const HomePage = () => {
    return (
        <div className='homepage'>
            <div className='directory-menu'>
                <MenuItem name={'BADU'} />
                <MenuItem name={'KADU'} />
                <MenuItem name={'NADU'} />
                <MenuItem name={'HUKA'} />


            </div>
        </div>
    )
}


export default HomePage;
